    <style>
      html { overflow: hidden; }

      .boot-cover { position: absolute; inset: 0; background: #e9f2ec; z-index: 10; }
      canvas { display: block; width: 100vw; height: 100vh; }

      .hud { position: absolute; left: var(--pad, 4vmin); top: var(--pad, 4vmin); display: flex; flex-direction: column; gap: 1.5vmin; color: #0b3d2e; }
      .row { display: flex; gap: 2vmin; align-items: center; }
      .badge { background: #ffffffbf; border: 0.3vmin solid #b7d4c7; color: #0b3d2e; border-radius: 2.2vmin; padding: 1.2vmin 2vmin; font-weight: 700; max-width: 25vmin; text-align: center; font-size: clamp(1.6vmin, 2vmin, 2.6vmin); white-space: nowrap; overflow: hidden; text-overflow: ellipsis; }
      .gas-btn { position: absolute; right: var(--pad, 4vmin); bottom: var(--pad, 4vmin); background: #1db954; color: white; border: none; border-radius: 6vmin; padding: 6vmin 7.5vmin; font-size: clamp(5vmin, 6vmin, 7.5vmin); font-weight: 800; box-shadow: 0 3vmin 8vmin rgba(29,185,84,0.35); cursor: pointer; }
      .gas-btn:active { transform: translateY(0.2vmin); }

      .center-banner { 
        position: absolute; 
        left: 50%; 
        top: var(--pad, 4vmin); 
        transform: translateX(-50%); 
        background: rgba(0, 0, 0, 0.7); /* Чёрная с прозрачностью 70% */
        border: 0.3vmin solid rgba(255, 255, 255, 0.3); /* Светлая рамка для контраста */
        border-radius: 2.6vmin; 
        padding: 1.2vmin 2vmin; 
        color: #ffffff; /* Белый текст для контраста с чёрным фоном */
        font-weight: 800; 
        font-size: clamp(2.4vmin, 3.2vmin, 3.6vmin); /* Увеличено для мобильной версии */
        max-width: 85vw; /* Ограничиваем ширину на мобильных */
        text-align: center;
        line-height: 1.2;
        box-shadow: 0 2vmin 6vmin rgba(0,0,0,0.4); /* Добавил тень как у плашки светофоров */
        backdrop-filter: blur(8px); /* Добавил размытие фона */
      }

      /* Мини-плашка с таймерами светофоров */
      .traffic-lights-panel {
        position: absolute;
        left: var(--pad, 4vmin);
        top: calc(var(--pad, 4vmin) + 22vmin); /* Опустил ещё ниже */
        background: rgba(0, 0, 0, 0.7); /* Чёрная с прозрачностью 70% */
        border: 0.3vmin solid rgba(255, 255, 255, 0.3); /* Светлая рамка для контраста */
        border-radius: 2.5vmin;
        padding: 1.5vmin 0.8vmin; /* Минимальные отступы */
        color: #ffffff; /* Белый текст для контраста с чёрным фоном */
        font-family: system-ui, -apple-system, Segoe UI, Roboto;
        width: 9vmin; /* Сделал ещё уже */
        box-shadow: 0 2vmin 6vmin rgba(0,0,0,0.4); /* Усилил тень для чёрной плашки */
        transition: all 0.3s ease;
        backdrop-filter: blur(8px);
      }

      /* Адаптивные размеры для планшетов (iPad) */
      @media (min-width: 768px) and (max-width: 1024px) {
        .traffic-lights-panel {
          width: 11vmin; /* Сделал ещё уже на планшетах */
          padding: 1.2vmin 0.6vmin;
        }
        
        .light-distance {
          font-size: clamp(2.0vmin, 2.4vmin, 2.8vmin); /* Уменьшил цифры на планшетах */
        }
        
        .light-timer {
          font-size: clamp(2.0vmin, 2.4vmin, 2.8vmin); /* Уменьшил цифры на планшетах */
        }
      }

      /* Адаптивные размеры для мобильных устройств */
      @media (max-width: 768px) {
        .traffic-lights-panel {
          width: 20vw; /* Сделал ещё уже на мобильных */
          padding: 1.8vmin 0.8vmin;
          border-radius: 3vmin;
          top: calc(var(--pad, 4vmin) + 24vmin); /* Опустил ещё ниже на мобильных */
        }

        .panel-title {
          font-size: clamp(2.4vmin, 2.8vmin, 3.2vmin); /* Уменьшил для узкой плашки на мобильных */
          margin-bottom: 1.8vmin;
          line-height: 0.9; /* Компактный междустрочный интервал на мобильных */
        }

        .traffic-light-item {
          padding: 1.2vmin 0.8vmin; /* Компактные отступы на мобильных */
          margin-bottom: 1vmin;
        }

        .light-indicator {
          width: 3vmin; /* Уменьшенный индикатор на мобильных */
          height: 3vmin;
          margin-right: 1vmin;
        }

        .light-distance {
          font-size: clamp(3.0vmin, 3.6vmin, 4.2vmin); /* Уменьшил цифры на мобильных */
        }

        .light-timer {
          font-size: clamp(3.0vmin, 3.6vmin, 4.2vmin); /* Уменьшил цифры на мобильных */
        }

        .center-banner {
          font-size: clamp(3.2vmin, 4vmin, 4.8vmin); /* Больше верхняя плашка на мобильных */
          padding: 2vmin 3vmin;
          background: rgba(0, 0, 0, 0.7); /* Чёрная с прозрачностью 70% на мобильных */
          color: #ffffff; /* Белый текст на мобильных */
          border: 0.3vmin solid rgba(255, 255, 255, 0.3); /* Светлая рамка на мобильных */
        }
      }

      .traffic-lights-panel.hidden {
        opacity: 0;
        transform: translateY(-10px);
        pointer-events: none;
      }

      .panel-title {
        font-size: clamp(1.4vmin, 1.8vmin, 2.2vmin); /* Уменьшил для узкой плашки */
        font-weight: 700;
        margin-bottom: 1.2vmin; /* Уменьшил отступ снизу */
        text-align: center;
        color: #ffffff; /* Белый цвет для контраста с чёрным фоном */
        letter-spacing: -0.01em;
        line-height: 1.0; /* Сделал междустрочный интервал компактнее */
      }

      .traffic-light-item {
        display: flex;
        align-items: center;
        justify-content: space-between;
        padding: 0.8vmin 0.4vmin; /* Ещё меньше отступы */
        margin-bottom: 0.6vmin;
        background: rgba(255, 255, 255, 0.15); /* Полупрозрачный белый на чёрном */
        border-radius: 1.2vmin;
        border: 0.15vmin solid rgba(255, 255, 255, 0.2); /* Светлая рамка */
        transition: all 0.4s cubic-bezier(0.4, 0, 0.2, 1);
        transform-origin: top center;
        min-height: 4vmin; /* Уменьшенная высота под меньшие цифры */
      }

      .traffic-light-item.removing {
        opacity: 0;
        transform: scaleY(0) translateY(-20px);
        margin-bottom: 0;
        padding-top: 0;
        padding-bottom: 0;
        border-width: 0;
      }

      .light-indicator {
        width: 1.8vmin; /* Уменьшил под меньшие цифры */
        height: 1.8vmin;
        border-radius: 50%;
        margin-right: 0.6vmin; /* Меньший отступ справа */
        transition: all 0.3s ease;
        box-shadow: 0 0 0.9vmin rgba(0,0,0,0.3);
        flex-shrink: 0;
      }

      .light-indicator.green {
        background: #4CAF50;
        box-shadow: 0 0 1.5vmin rgba(76, 175, 80, 0.7);
      }

      .light-indicator.red {
        background: #F44336;
        box-shadow: 0 0 1.5vmin rgba(244, 67, 54, 0.7);
      }

      .light-info {
        flex: 1;
        display: flex;
        align-items: center;
        justify-content: space-between; /* Расстояние и секунды в одну строку */
        min-width: 0; /* Позволяет сжатие */
        gap: 0.3vmin; /* Минимальный зазор между элементами */
      }

      .light-distance {
        font-size: clamp(1.8vmin, 2.2vmin, 2.6vmin); /* Уменьшил цифры */
        font-weight: 600;
        color: #cccccc; /* Светло-серый для дистанции на чёрном фоне */
        white-space: nowrap; /* Не переносить текст */
        overflow: hidden;
        text-overflow: ellipsis;
      }

      .light-timer {
        font-size: clamp(1.8vmin, 2.2vmin, 2.6vmin); /* Уменьшил цифры */
        font-weight: 700;
        color: #ffffff; /* Белый для таймера на чёрном фоне */
        text-align: right;
        white-space: nowrap; /* Не переносить текст */
        min-width: 2.5vmin; /* Минимальная ширина для цифр */
      }

      .light-timer.green {
        color: #4CAF50; /* Яркий зелёный для видимости на чёрном */
      }

      .light-timer.red {
        color: #FF5252; /* Яркий красный для видимости на чёрном */
      }

      .finish-overlay { position: absolute; inset: 0; display: none; align-items: center; justify-content: center; background: rgba(0,0,0,0.55); z-index: 100; }
      .finish-card {

      .logo-section {

      .logo-2gis {

        opacity: 0.95; 
      }
      .cta {

        white-space: nowrap;
